import PostList from './pages/PostList';
import {BrowserRouter,Routes,Route} from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
			<Routes>
				<Route path='/' element={<PostList/>} />
				<Route path='/posts' element={<PostList/>} />
			</Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
